import "../styles/navbar.css";
import { useEffect, useState } from "react";
import {useNavigate} from "react-router-dom"

function Navbar() {
    const [toggleMenu, setToggleMenu] = useState(false);
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const navigate = useNavigate();

    const handleMenuBtn = () => {
        setToggleMenu(!toggleMenu); // Toggle menu visibility
    };


    function handleLogin(){
        isLoggedIn ? logout() : navigate("/login")
    }

    function loginStatus(){
        const token = localStorage.getItem('accessToken')
        if (token){
            setIsLoggedIn(true)
        }
    }
    useEffect(()=>{
        loginStatus()
    },[])


    function logout() {
        refreshAccessToken().then((newAccessToken) => {
            if (!newAccessToken) {
                console.error('Failed to refresh token before logout');
                return;
            }

            const refreshToken = localStorage.getItem("refreshToken");
            if (!refreshToken) {
                console.error("No refresh token found.");
                return; // Prevent logout attempt if no refresh token is available
            }

            fetch("http://127.0.0.1:8000/quizapp/logout/", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({ refresh_token: refreshToken }) // Send refresh token to logout
            })
            .then(res => {
                if (res.ok) {
                    setIsLoggedIn(false);
                    localStorage.removeItem("accessToken");
                    localStorage.removeItem("refreshToken");
                    navigate("/login");
                } else {
                    console.log("Logout failed: ", res.status);
                }
            })
            .catch((error) => {
                console.error("Error logging out:", error);
            });
        });
    }


    function refreshAccessToken() {
        const refreshToken = localStorage.getItem("refreshToken");
        return fetch("http://127.0.0.1:8000/quizapp/token/refresh/", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify({ refresh: refreshToken }),
        })
        .then(res => {
            if (!res.ok) throw new Error('Failed to refresh token');
            return res.json();
        })
        .then(data => {
            localStorage.setItem('accessToken', data.access); // Store the new access token
            return data.access;
        })
        .catch(err => {
            console.error('Error refreshing access token:', err);
            return null; // Return null if the refresh fails
        });
    }





    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark back-color">
                <a className="navbar-brand" href="#">PyGame</a>
                <button
                    className="navbar-toggler"
                    type="button"
                    data-toggle="collapse"
                    data-target="#navbarNav"
                    aria-controls="navbarNav"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ml-auto"> {/* Ensure ml-auto is used to push items to the right */}
                        <li className="nav-item">
                            { isLoggedIn && <a className="nav-link" id="user" href="">User</a>}
                        </li>
                        <li className="nav-item">
                            <button id="logout" className="btn btn-primary" onClick={handleLogin}>{ isLoggedIn ? ('Log out'): ('Log in')}</button>
                        </li>
                        <li className="nav-item">
                            <img src="" alt="" />
                        </li>
                    </ul>
                </div>
            </nav>

            <div className={toggleMenu ? "expanded sidebar" : "sidebar"} id="sidebar">
                <button className="btn btn-primary" id="menuButton" onClick={handleMenuBtn}>☰</button>
                <div className="canvas-menu" id="canvasMenu">
                    <h3>
                        <a className="decorate" href="scores.html">Scores</a>
                    </h3>
                </div>
            </div>
        </div>
    );
}

export default Navbar;
